webpackJsonp([0xf0aa93193e0b],{508:function(a,n){a.exports={data:{site:{siteMetadata:{startDate:"2018-06-06",lessons:8,noClass:[4]}},markdownRemark:{html:'<p>In this lesson we will be talking about block elements. A block element is any element that when rapping content is content will be displayed on his online. Block elements are able to display padding on the top and the bottom, have a width set on them.</p>\n<p>Block elements may also have additional styles based on the tag type.</p>\n<h2>Paragraph</h2>\n<p>The <code class="language-text">&lt;p&gt;</code> element (or HTML Paragraph Element) represents a paragraph of text. Paragraphs are usually represented in visual media as blocks of text that are separated from adjacent blocks by vertical blank space. Paragraphs can contain one or more sentences of content.</p>\n<h3>Example</h3>\n<iframe height=\'265\' scrolling=\'no\' title=\'Paragraph\' src=\'//codepen.io/danhahn/embed/xrwKMe/?height=265&theme-id=light&default-tab=html,result&embed-version=2\' frameborder=\'no\' allowtransparency=\'true\' allowfullscreen=\'true\' style=\'width: 100%;\'>See the Pen <a href=\'https://codepen.io/danhahn/pen/xrwKMe/\'>Paragraph</a> by Dan Hahn (<a href=\'https://codepen.io/danhahn\'>@danhahn</a>) on <a href=\'https://codepen.io\'>CodePen</a>.\n</iframe>\n<h2>Headings</h2>\n<p>Heading elements implement six levels of document headings, <code class="language-text">&lt;h1&gt;</code> is the most important and <code class="language-text">&lt;h6&gt;</code> is the least. A heading element briefly describes the topic of the section it introduces. Heading information may be used by user agents, for example, to construct a table of contents for a document automatically( just like the fixed sider bar of this page on the right).</p>\n<p><strong>Usage note:</strong></p>\n<ul>\n<li>Do not use lower levels to decrease heading font size: use the CSS font-size property instead.</li>\n<li>Avoid skipping heading levels: always start from <code class="language-text">&lt;h1&gt;</code>, next use <code class="language-text">&lt;h2&gt;</code> and so on.</li>\n</ul>\n<h3>Example</h3>\n<iframe height=\'265\' scrolling=\'no\' title=\'Headline\' src=\'//codepen.io/danhahn/embed/KqdPrZ/?height=265&theme-id=light&default-tab=html,result&embed-version=2\' frameborder=\'no\' allowtransparency=\'true\' allowfullscreen=\'true\' style=\'width: 100%;\'>See the Pen <a href=\'https://codepen.io/danhahn/pen/KqdPrZ/\'>Headline</a> by Dan Hahn (<a href=\'https://codepen.io/danhahn\'>@danhahn</a>) on <a href=\'https://codepen.io\'>CodePen</a>.\n</iframe>\n<h3>Usage</h3>\n<iframe height=\'265\' scrolling=\'no\' title=\'Headline Example\' src=\'//codepen.io/danhahn/embed/weKwbe/?height=265&theme-id=light&default-tab=html,result&embed-version=2\' frameborder=\'no\' allowtransparency=\'true\' allowfullscreen=\'true\' style=\'width: 100%;\'>See the Pen <a href=\'https://codepen.io/danhahn/pen/weKwbe/\'>Headline Example</a> by Dan Hahn (<a href=\'https://codepen.io/danhahn\'>@danhahn</a>) on <a href=\'https://codepen.io\'>CodePen</a>.\n</iframe>\n<h3>Line break</h3>\n<p>The HTML element line break <code class="language-text">&lt;br&gt;</code> produces a line break in text (carriage-return). It is useful for writing a poem or an address, where the division of lines is significant.</p>\n<p>Do not use <code class="language-text">&lt;br&gt;</code> to increase the gap between lines of text; use the CSS <code class="language-text">margin</code> property or the <code class="language-text">&lt;p&gt;</code> element.</p>\n<h3>Example</h3>\n<iframe height=\'265\' scrolling=\'no\' title=\'Line Break\' src=\'//codepen.io/danhahn/embed/JJYjEo/?height=265&theme-id=light&default-tab=html,result&embed-version=2\' frameborder=\'no\' allowtransparency=\'true\' allowfullscreen=\'true\' style=\'width: 100%;\'>See the Pen <a href=\'https://codepen.io/danhahn/pen/JJYjEo/\'>Line Break</a> by Dan Hahn (<a href=\'https://codepen.io/danhahn\'>@danhahn</a>) on <a href=\'https://codepen.io\'>CodePen</a>.\n</iframe>\n<p><strong>Note:</strong> <code class="language-text">address</code> tag is a new block element used to define an address.</p>\n<h2>Lists</h2>\n<p>The <code class="language-text">&lt;ol&gt;</code> Element (or Ordered List) represents an ordered list of items. Typically, ordered-list items are displayed with a preceding numbering, which can be of any form, like numerals, letters or Romans numerals or even simple bullets.</p>\n<iframe height=\'350\' scrolling=\'no\' title=\'Lists\' src=\'//codepen.io/danhahn/embed/KqdKvG/?height=265&theme-id=light&default-tab=html,result&embed-version=2\' frameborder=\'no\' allowtransparency=\'true\' allowfullscreen=\'true\' style=\'width: 100%;\'>See the Pen <a href=\'https://codepen.io/danhahn/pen/KqdKvG/\'>Lists</a> by Dan Hahn (<a href=\'https://codepen.io/danhahn\'>@danhahn</a>) on <a href=\'https://codepen.io\'>CodePen</a>.\n</iframe>\n<p><strong>Note:</strong> This style of the bullets or numbers is not defined in the HTML description of the page, but in its associated CSS, using the <code class="language-text">list-style-type</code> property.</p>\n<p>The <code class="language-text">&lt;li&gt;</code> element (List Item) is used to represent an item in a list.</p>\n<p>There is no limitation to the depth and overlap of lists defined with the <code class="language-text">&lt;ol&gt;</code> and <code class="language-text">&lt;ul&gt;</code> elements.</p>\n<iframe height=\'280\' scrolling=\'no\' title=\'Nested List\' src=\'//codepen.io/danhahn/embed/owjNoL/?height=265&theme-id=light&default-tab=html,result&embed-version=2\' frameborder=\'no\' allowtransparency=\'true\' allowfullscreen=\'true\' style=\'width: 100%;\'>See the Pen <a href=\'https://codepen.io/danhahn/pen/owjNoL/\'>Nested List</a> by Dan Hahn (<a href=\'https://codepen.io/danhahn\'>@danhahn</a>) on <a href=\'https://codepen.io\'>CodePen</a>.\n</iframe>\n<h2>Blockquote</h2>\n<p>The <code class="language-text">&lt;blockquote&gt;</code> Element (or HTML Block Quotation Element) indicates that the enclosed text is an extended quotation. Usually, this is rendered visually by indentation.</p>\n<h3>Example</h3>\n<iframe height=\'470\' scrolling=\'no\' title=\'Blockquote\' src=\'//codepen.io/danhahn/embed/gRaOKo/?height=408&theme-id=light&default-tab=html,result&embed-version=2\' frameborder=\'no\' allowtransparency=\'true\' allowfullscreen=\'true\' style=\'width: 100%;\'>See the Pen <a href=\'https://codepen.io/danhahn/pen/gRaOKo/\'>Blockquote</a> by Dan Hahn (<a href=\'https://codepen.io/danhahn\'>@danhahn</a>) on <a href=\'https://codepen.io\'>CodePen</a>.\n</iframe>\n<h2>Page divisions</h2>\n<p>The <code class="language-text">&lt;div&gt;</code> element (or Document Division Element) is the generic container for flow content, which does not inherently represent anything. It can be used to group elements for styling purposes (using the class or id attributes), or because they share attribute values, such as lang. It should be used only when no other semantic element (such as <code class="language-text">&lt;article&gt;</code> or <code class="language-text">&lt;nav&gt;</code>) is appropriate.</p>\n<iframe height=\'428\' scrolling=\'no\' title=\'Div\' src=\'//codepen.io/danhahn/embed/bRVGxj/?height=428&theme-id=light&default-tab=html,result&embed-version=2\' frameborder=\'no\' allowtransparency=\'true\' allowfullscreen=\'true\' style=\'width: 100%;\'>See the Pen <a href=\'https://codepen.io/danhahn/pen/bRVGxj/\'>Div</a> by Dan Hahn (<a href=\'https://codepen.io/danhahn\'>@danhahn</a>) on <a href=\'https://codepen.io\'>CodePen</a>.\n</iframe>\n<p><strong>Note:</strong> The <code class="language-text">&lt;div&gt;</code> does not have any visual changes. All changes will be applied in the css.</p>\n<h2>Div like elements</h2>\n<p>With HTML 5 there are a number of new elements that are designed to help better semantically lay out the page. These tags act the same as the <code class="language-text">&lt;div&gt;</code> tag but have better naming to help define sections within the page. Well these elements behave the same as a <code class="language-text">&lt;div&gt;</code> they make it easy for others to come in and understand the code.</p>\n<h3>section</h3>\n<p>The <code class="language-text">&lt;section&gt;</code> element represents a generic section of a document, i.e., a thematic grouping of content, typically with a heading. Each <code class="language-text">&lt;section&gt;</code> should be identified, typically by including a heading (<code class="language-text">&lt;h1&gt;</code>-<code class="language-text">&lt;h6&gt;</code> element) as a child of the <code class="language-text">&lt;section&gt;</code> element.</p>\n<div class="gatsby-highlight" data-language="html">\n      <pre class="language-html"><code class="language-html"><span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>section</span><span class="token punctuation">></span></span>\n    <span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>h1</span><span class="token punctuation">></span></span>Heading<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>h1</span><span class="token punctuation">></span></span>\n    <span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>p</span><span class="token punctuation">></span></span>Bunch of awesome content<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>p</span><span class="token punctuation">></span></span>\n<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>section</span><span class="token punctuation">></span></span></code></pre>\n      </div>\n<h3>header</h3>\n<p>The <code class="language-text">&lt;header&gt;</code> element represents a group of introductory or navigational aids. It may contain some heading elements but also other elements like a logo, wrapped section\'s header, a search form, and so on.</p>\n<div class="gatsby-highlight" data-language="html">\n      <pre class="language-html"><code class="language-html"><span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>header</span><span class="token punctuation">></span></span>\n    <span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>h1</span><span class="token punctuation">></span></span>Lorem ipsum.<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>h1</span><span class="token punctuation">></span></span>\n<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>header</span><span class="token punctuation">></span></span></code></pre>\n      </div>\n<h3>nav</h3>\n<p>The <code class="language-text">&lt;nav&gt;</code> element Navigation Element) represents a section of a page that links to other pages or to parts within the page: a section with navigation links.</p>\n<div class="gatsby-highlight" data-language="html">\n      <pre class="language-html"><code class="language-html"><span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>nav</span><span class="token punctuation">></span></span>\n    <span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>ul</span><span class="token punctuation">></span></span>\n        <span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>li</span><span class="token punctuation">></span></span><span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>a</span> <span class="token attr-name">href</span><span class="token attr-value"><span class="token punctuation">=</span><span class="token punctuation">"</span>#<span class="token punctuation">"</span></span><span class="token punctuation">></span></span>Home<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>a</span><span class="token punctuation">></span></span><span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>li</span><span class="token punctuation">></span></span>\n        <span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>li</span><span class="token punctuation">></span></span><span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>a</span> <span class="token attr-name">href</span><span class="token attr-value"><span class="token punctuation">=</span><span class="token punctuation">"</span>#<span class="token punctuation">"</span></span><span class="token punctuation">></span></span>About<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>a</span><span class="token punctuation">></span></span><span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>li</span><span class="token punctuation">></span></span>\n        <span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>li</span><span class="token punctuation">></span></span><span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>a</span> <span class="token attr-name">href</span><span class="token attr-value"><span class="token punctuation">=</span><span class="token punctuation">"</span>#<span class="token punctuation">"</span></span><span class="token punctuation">></span></span>Contact<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>a</span><span class="token punctuation">></span></span><span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>li</span><span class="token punctuation">></span></span>\n    <span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>ul</span><span class="token punctuation">></span></span>\n<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>nav</span><span class="token punctuation">></span></span></code></pre>\n      </div>\n<h3>footer</h3>\n<p>The <code class="language-text">&lt;footer&gt;</code> element represents a footer for its nearest sectioning content or sectioning root element. A footer typically contains information about the author of the section, copyright data or links to related documents.</p>\n<div class="gatsby-highlight" data-language="html">\n      <pre class="language-html"><code class="language-html"><span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>footer</span><span class="token punctuation">></span></span>\n    <span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>p</span><span class="token punctuation">></span></span><span class="token entity" title="&copy;">&amp;copy;</span> 2001 Some Website<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>p</span><span class="token punctuation">></span></span>\n<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>footer</span><span class="token punctuation">></span></span></code></pre>\n      </div>\n<h3>article</h3>\n<p>The <code class="language-text">&lt;article&gt;</code> element represents a self-contained composition in a document, page, application, or site, which is intended to be independently distributable or reusable (e.g., in syndication). This could be a forum post, a magazine or newspaper article, a blog entry, an object, or any other independent item of content. Each <code class="language-text">&lt;article&gt;</code> should be identified, typically by including a heading (<code class="language-text">&lt;h1&gt;</code>-<code class="language-text">&lt;h6&gt;</code> element) as a child of the <code class="language-text">&lt;article&gt;</code> element.</p>\n<div class="gatsby-highlight" data-language="html">\n      <pre class="language-html"><code class="language-html"><span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>article</span><span class="token punctuation">></span></span>\n\t<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>h2</span><span class="token punctuation">></span></span>Lorem ipsum.<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>h2</span><span class="token punctuation">></span></span>\n\t<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>p</span><span class="token punctuation">></span></span>Lorem ipsum dolor sit amet, consectetur adipisicing elit. Quos, officiis?<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>p</span><span class="token punctuation">></span></span>\n\t<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>p</span><span class="token punctuation">></span></span>Deserunt, laudantium amet hic ex unde id rem cum nemo.<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>p</span><span class="token punctuation">></span></span>\n<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>article</span><span class="token punctuation">></span></span></code></pre>\n      </div>\n<h3>aside</h3>\n<p>The HTML <code class="language-text">&lt;aside&gt;</code> element represents a section of the page with content connected tangentially to the rest, which could be considered separate from that content. These sections are often represented as sidebars or inserts. They often contain the definitions on the sidebars, such as definitions from the glossary; there may also be other types of information, such as related advertisements; the biography of the author; web applications; profile information.</p>\n<div class="gatsby-highlight" data-language="html">\n      <pre class="language-html"><code class="language-html"><span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>section</span><span class="token punctuation">></span></span>\n\t<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>article</span><span class="token punctuation">></span></span>\n\t\t<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>h2</span><span class="token punctuation">></span></span>Lorem ipsum.<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>h2</span><span class="token punctuation">></span></span>\n\t\t<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>p</span><span class="token punctuation">></span></span>Lorem ipsum dolor sit amet, consectetur adipisicing elit. Assumenda, deserunt?<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>p</span><span class="token punctuation">></span></span>\n\t\t<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>p</span><span class="token punctuation">></span></span>Quod vitae laborum, perferendis praesentium vel neque nisi consequatur illum.<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>p</span><span class="token punctuation">></span></span>\n\t<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>article</span><span class="token punctuation">></span></span>\n\t<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>aside</span><span class="token punctuation">></span></span>\n\t\t<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>ul</span><span class="token punctuation">></span></span>\n\t\t\t<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>li</span><span class="token punctuation">></span></span>Lorem ipsum.<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>li</span><span class="token punctuation">></span></span>\n\t\t\t<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>li</span><span class="token punctuation">></span></span>Dicta, sed!<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>li</span><span class="token punctuation">></span></span>\n\t\t\t<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>li</span><span class="token punctuation">></span></span>Eaque, tempore.<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>li</span><span class="token punctuation">></span></span>\n\t\t<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>ul</span><span class="token punctuation">></span></span>\n\t<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>aside</span><span class="token punctuation">></span></span>\n<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>section</span><span class="token punctuation">></span></span></code></pre>\n      </div>\n<h2>Page Layout</h2>\n<p>You can mix and match the element in any way that works for your design. Most of the visual changes will be handled with your CSS.</p>\n<iframe height=\'680\' scrolling=\'no\' title=\'Div Like Tags\' src=\'//codepen.io/danhahn/embed/PjPwyv/?height=265&theme-id=light&default-tab=html,result&embed-version=2\' frameborder=\'no\' allowtransparency=\'true\' allowfullscreen=\'true\' style=\'width: 100%;\'>See the Pen <a href=\'https://codepen.io/danhahn/pen/PjPwyv/\'>Div Like Tags</a> by Dan Hahn (<a href=\'https://codepen.io/danhahn\'>@danhahn</a>) on <a href=\'https://codepen.io\'>CodePen</a>.\n</iframe>',frontmatter:{lesson:"Block Elements",title:"Lesson 1",lessonId:1,downloads:null}},allMarkdownRemark:{edges:[{node:{id:"/Users/dhahn/dev/html-class-g/src/pages/1/index.md absPath of file >>> MarkdownRemark",frontmatter:{title:"Lesson 1",lesson:"Introduction"},fields:{slug:"/1/index.html"}}},{node:{id:"/Users/dhahn/dev/html-class-g/src/pages/1/editors.md absPath of file >>> MarkdownRemark",frontmatter:{title:"Lesson 1",lesson:"HTML Editors"},fields:{slug:"/1/editors.html"}}},{node:{id:"/Users/dhahn/dev/html-class-g/src/pages/1/template.md absPath of file >>> MarkdownRemark",frontmatter:{title:"Lesson 1",lesson:"Building a HTML template"},fields:{slug:"/1/template.html"}}},{node:{id:"/Users/dhahn/dev/html-class-g/src/pages/1/block.md absPath of file >>> MarkdownRemark",frontmatter:{title:"Lesson 1",lesson:"Block Elements"},fields:{slug:"/1/block.html"}}},{node:{id:"/Users/dhahn/dev/html-class-g/src/pages/1/classwork.md absPath of file >>> MarkdownRemark",frontmatter:{title:"Lesson 1",lesson:"Classwork"},fields:{slug:"/1/classwork.html"}}},{node:{id:"/Users/dhahn/dev/html-class-g/src/pages/1/homework.md absPath of file >>> MarkdownRemark",frontmatter:{title:"Lesson 1",lesson:"Homework"},fields:{slug:"/1/homework.html"}}}]}},pathContext:{slug:"/1/block.html",title:"Lesson 1"}}}});
